<https://raw.githubusercontent.com/PolianaLabs/poliana/master/ontology/article/EU_2018_2001#paragraph1>
    a poliana:Paragraph ;
    poliana:text "Member States shall require the relevant economic operators to enter into that database information on the transactions made and the sustainability characteristics of those fuels, including their life-cycle greenhouse gas emissions, starting from their point of production to the fuel supplier that places the fuel on the market." .

