    a poliana:Paragraph ;
    poliana:text "By 31 December 2021, member states shall take measures to ensure the availability of fuels from renewable sources for transport including with regard to publicly accessible high-power recharging points and other refuelling infrastructure as provided for in their national policy frameworks in accordance with Directive 2014/94/EU." .

