    a poliana:Paragraph ;
    poliana:text "Member States shall have access to the union database referred to in paragraph 2 of this article. They shall take measures to ensure that economic operators enter accurate information into the relevant database." .

<https://raw.githubusercontent.com/PolianaLabs/poliana/master/ontology/article/EU_2018_2001#paragraph5>
    a poliana:Paragraph ;
    poliana:text "By 31 December 2021, the Commission shall adopt delegated acts in accordance with Article 35 to supplement this Directive by specifying the methodology to determine the share of biofuel, and biogas for transport, resulting from biomass being processed with fossil fuels in a common process." .

