    a poliana:Paragraph ;
    poliana:text "By 31 December 2025, in the context of the biennial assessment of progress made pursuant to Regulation (EU) 2018/1999, the Commission shall assess whether the obligation relating to advanced biofuels and biogas produced from feedstock listed in part A of Annex IX laid down in the fourth subparagraph of Article 25(1) effectively stimulates innovation and ensures greenhouse gas emissions savings in the transport sector." .

<https://raw.githubusercontent.com/PolianaLabs/poliana/master/ontology/article/EU_2018_2001#provision1>
    a poliana:Provision ;
    poliana:text "Fuel suppliers shall enter the information necessary to verify compliance with the requirements laid down in the first and fourth subparagraphs of Article 25(1) into the relevant database." .

<https://raw.githubusercontent.com/PolianaLabs/poliana/master/ontology/article/EU_2018_2001#provision2>
    a poliana:Provision ;
    poliana:text "The Commission shall require the schemes that are the subject of a decision pursuant to Article 30(4) of this Directive to verify compliance with that requirement when checking the accuracy of the information entered into the database." .

